void thread_exit(void){
    //printf("exiting?!\n");
    if(current_thread->next != current_thread){
        struct thread* tmp = current_thread;
        current_thread = current_thread -> next;
        free(current_thread -> stack);
        free(tmp);
        dispatch();
    }
    else{
