# 
#  generating Fibonacci series using recursion
#  gen. function enclosed by external function
# 
def fibre(max) -> list:

    lst = []
    def genfib(prev:int, act:int, n:int, l:list) -> list:
        if prev < n:
            l.append(prev)
            genfib(act, prev+act, n, l)
        return l

    return genfib(0,1, max,lst)

def fiboyield(N):
